<!doctype html>
<html lang="en">
	<head>
		<meta charset="UTF-8" />
		<title>Grafana Dashboard Report</title>
		<style>
			:root {
				--border-radius: 6px;
				--gap: 20px;
			}
			html,
			body {
				padding: 0;
				margin: 0;
				font-family: Arial, sans-serif;
			}
			* {
				padding: 0;
				margin: 0;
				box-sizing: border-box;
			}
			.screenshots-container {
				display: flex;
				flex-direction: column;
				width: 100%;
				padding: var(--gap);
			}
			.screenshot-row {
				display: flex;
				gap: var(--gap);
				width: 100%;
				page-break-inside: avoid;
				padding: calc(var(--gap) / 2) 0;
			}
			.screenshot {
				flex: 1 1 0px;
				border-radius: var(--border-radius);
				overflow: hidden;
			}
			.screenshot img {
				width: 100%;
				height: 100%;
				display: block;
			}

			.cover-box {
				page-break-after: always;
				width: 100%;
				height: 1030px;
				overflow: hidden;
				position: relative;
			}

			.cover-box .cover-bg {
				width: 100%;
				height: 100%;
				display: block;
			}
			.cover-box .cover-meta {
				position: absolute;
				top: 400px;
				left: 100px;
			}
			.cover-box .cover-meta .cover-logo {
				height: 80px;
				margin-bottom: 30px;
			}
			.cover-box .cover-meta .cover-company {
				font-size: 40px;
				font-weight: bold;
				margin-bottom: 30px;
			}
			.cover-box .cover-meta .cover-subtitle {
				font-size: 25px;
				margin-bottom: 5px;
			}
			.cover-box .cover-meta .cover-timerange {
				font-size: 20px;
				opacity: 0.6;
			}
		</style>
	</head>
